window.bookSummaryJSON = "The dust of Battle has settled over the Land.<br>War cries of victory are Echoed throughout Hell.<br>And now I can get back to my life of Lego and Star Trek,<br>With one big difference,<br>I now have a King to share it with.<br><br>But it seems as if Fate had a different idea for me,<br>And any plans for peace are shattered with the strength of my dreams,<br>Nightmares of one last foe I must face.<br>For the Wraith Master still haunts me and the vow I made even more so.<br><br>Now I must choose to walk the path of peace,<br>or the path of a promise once made.<br>A promise that will lead me to a place unknown,<br>One not even Lucius can save me from.<br>Not when he is the enemy.<br>In this,<br>Knights of Past."; 
